    .then(result=>{
        console.log(result)
       if(result.error){
          M.toast({html: result.error,classes:"#c62828 red darken-3"})
       }
       else{
            console.log(result)
            setData(result)
       }
    }).catch(err=>{
        console.log(err)
    })
   },[])
